import hashlib
import json
import threading
from time import sleep

import requests


def Login(_serverIP, _username, _password):
    serverIP = _serverIP
    username = _username
    password = _password

    # Prepare the first authorize request
    payload = {'userName': username,
               'ipAddress': '',
               'clientType': 'WINPC'
               }
    headers = {'content-type': 'application/json'}
    loginUrl = 'http://%s/admin/API/accounts/authorize' % serverIP

    r = requests.post(loginUrl, data=json.dumps(payload), headers=headers)

    # Print the request
    print(r.text)

    # Parser the request reply
    recStr = r.json()
    realm = recStr["realm"]
    randomKey = recStr["randomKey"]
    # Print the values
    print("realm: " + realm)
    print("RandomKey: " + randomKey)

    # uncomment the line with the randomkey below to evaluate the algorithm compared to Documentation  example
    # If uses the same randomkey as documentation example, the signature generated is the same as the documentation example.
    # randomKey = '9c2b603650f54bcb'
    # print("randomkey de teste: " + randomKey)

    # First signature step
    tempSingnature = hashlib.md5(password.encode('utf-8'))
    print("Passwd MD5: " + tempSingnature.hexdigest())

    # Second signature step
    tempStr = tempSingnature.hexdigest()
    tempStr = username + tempStr
    tempSig = hashlib.md5(tempStr.encode('utf-8'))
    print("Username + PasswdMD5 : " + tempSig.hexdigest())

    # Third signature step
    tempSig = hashlib.md5(tempSig.hexdigest().encode('utf-8'))
    print("MD5 de tempSigMD5: " + tempSig.hexdigest())

    # Fourth signature step
    tempStr = username + ":" + realm + ":" + tempSig.hexdigest()
    print("STR:    " + tempStr)
    tempSig = hashlib.md5(tempStr.encode('utf-8'))
    print("md5(userName:realm temp) :" + tempSig.hexdigest())

    # Fifth signature step
    tempStr = tempSig.hexdigest() + ":" + randomKey
    print("STR sig: " + tempStr)
    signature = hashlib.md5(tempStr.encode('utf-8'))
    strSig = signature.hexdigest()
    print("Signature: " + strSig)

    # Second authorize request
    payload = {'userName': username,
               'randomKey': randomKey,
               'mac': '',
               'encryptType': 'MD5',
               'ipAddress': '',
               'signature': strSig,
               'clientType': 'WINPC'}
    loginUrl = 'http://%s/admin/API/accounts/authorize' % serverIP
    r = requests.post(loginUrl, data=json.dumps(payload), headers=headers)
    # Print the second request answer
    print('Second request: ' + r.text)
    recStr = r.json()
    token = recStr["token"]

    updateThread = threading.Thread(target=updateToken, args=(serverIP, token, tempSig, headers,))
    updateThread.start()

    return [token, tempSig, signature];


    ###Get RTSP Url
    # Need to get a new randomkey to generate the new signature again
    ###End Get RTSP URL

def updateToken(serverIP, token, tempSig, headers):
    signature = getSignature(token, tempSig)
    headers = {'content-type': 'application/json',
               'X-Subject-Token': token}
    payload = {'signature': signature.hexdigest()}
    loginUrl = 'http://%s//admin/API/accounts/updateToken' % serverIP
    i = 3
    # while i > 0:
    while True:
        r = requests.post(loginUrl, data=json.dumps(payload), headers=headers)
        # print('Update Reply: '+r.text)
        sleep(20)
        i = i - 1
    cancelToken(serverIP, token, tempSig, headers)


def cancelToken(serverIP, token, tempSig, headers):
    str = tempSig.hexdigest() + ":" + token
    signature = hashlib.md5(str.encode('utf-8'))
    headers = {'content-type': 'application/json',
               'X-Subject-Token': token}
    payload = {'signature': signature.hexdigest()}
    loginUrl = 'http://%s//admin/API/accounts/unauthorize' % serverIP
    r = requests.post(loginUrl, data=json.dumps(payload), headers=headers)
    print('Cancel reply: ' + r.text)
    print('Login cancelled')


def getSignature(token, tempSig):
    str = tempSig.hexdigest() + ":" + token
    signature = hashlib.md5(str.encode('utf-8'))
    return signature


# The callback for when the client receives a CONNACK response from the server.
def on_connect(client, userdata, rc):
    print("Connected with result code " + str(rc))
    # Subscribing in on_connect() means that if we lose the connection and
    # reconnect then subscriptions will be renewed.


def on_disconnect(client, userdata, rc):
    print("Disconnected with result code " + str(rc))


# The callback for when a PUBLISH message is received from the server.
def on_message(client, userdata, msg):
    print('Message received:' + msg.topic + " " + str(msg.payload))


def on_publish(mqttc, obj, mid):
    print("mid: " + str(mid))


def on_subscribe(mqttc, obj, mid, granted_qos):
    print("Subscribed: " + str(mid) + " " + str(granted_qos))

