#MQ subscribe
def get_MQ_address(serverIP, token, signature):

    headers = {'content-type': 'application/json', 'X-Subject-Token': token}
    payload = {'signature': signature.hexdigest()}
    loginUrl = 'http://%s//admin/API/BRM/Config/GetMqConfig' % serverIP
    r = requests.post(loginUrl, data=json.dumps(payload), headers=headers)
    #print('MQ Config: ' + r.text + '\n')
    recStr = r.json()
    mqttPassword = recStr['data']['password']
    mqttMqtt = recStr['data']['mqtt']
    mqttOpenWireAddr = recStr['data']['addr']
    mqttUserName = recStr['data']['userName']

    return [r, mqttPassword,mqttMqtt,mqttOpenWireAddr,mqttUserName];
    print("End")



