def list_department(serverIP, token, tempSig):

    signature = getSignature(token, tempSig)
    headers = {'content-type': 'application/json',
               'X-Subject-Token': token}
    payload = {'signature': signature.hexdigest()}
    loginUrl = 'http://%s//admin/API/tree/deviceOrg?channelType=1,2,3,4,5,6,7,8,10,11,12,14,15,33&sort=&orgCode=' % serverIP
    r = requests.get(loginUrl, data=json.dumps(payload), headers=headers)
    # print('Department list: '+r.text+'\n')

    return r;



