def get_person(serverIP, token, ID):
    headers = {'content-type': 'application/json', 'X-Subject-Token': token}
    loginUrl = 'http://%s//OBMS/accessControl/person' % serverIP + '/' + ID
    r = requests.get(loginUrl, headers=headers)
    print('Get person: ' + r.text + '\n')
    return r;


def delete_person(serverIP, token, ID):
    headers = {'content-type': 'application/json', 'X-Subject-Token': token}
    loginUrl = 'http://%s//OBMS/accessControl/person?personIds=' % serverIP + ID
    r = requests.delete(loginUrl, headers=headers)
    print('Delete person: ' + r.text + '\n')
    return r;

