def close_door(serverIP, token, dev_channel):
    headers = {'content-type': 'application/json', 'X-Subject-Token': token}
    payload = {
        "status": "0",
        "channelId": dev_channel
    }
    loginUrl = 'http://%s//OBMS/accessControl/door/control' % serverIP + '/'
    r = requests.post(loginUrl, data=json.dumps(payload), headers=headers)
    print('Close door: ' + r.text + '\n')


def open_door(serverIP, token, dev_channel):
    headers = {'content-type': 'application/json', 'X-Subject-Token': token}
    payload = {
        "status": "1",
        "channelId": dev_channel
    }
    loginUrl = 'http://%s//OBMS/accessControl/door/control' % serverIP + '/'
    r = requests.post(loginUrl, data=json.dumps(payload), headers=headers)
    print('Open door: ' + r.text + '\n')
